import { React, useEffect, useState } from "react";
import { Button } from "react-bootstrap";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import NavDropdown from "react-bootstrap/NavDropdown";
import Swal from "sweetalert2";

import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link,
  useLocation,
} from "react-router-dom";

import Home from "../pages/Home";
import logo from "../assets/logo.png";
import Product from "../pages/Product";
import Contact from "../pages/Contact";
import AboutUs from "../pages/AboutUs";
import Order from "../pages/Order";
import Login from "../pages/Login";
import Dashboard from "../pages/Dashboard";

const nav1style = {
  zIndex: 9999,
  background:
    "linear-gradient(to bottom, rgba(0,0,4,0.65172006302521) 0%, rgba(0,0,0,0.19233630952380953) 46%, rgba(0,0,0,0) 100%)",
  color: "white",
};

const nav2style = {
  zIndex: 9999,
  backgroundColor: "rgba(0, 0, 0, 0.8)",
};

const whiteText = {
  color: "white",
};

const logout_aksi = async () => {
  let token = sessionStorage.getItem("access_token");
  fetch("http://127.0.0.1:8000/api/logout", {
    method: "POST",
    headers: {
      Authorization: `Bearer ${token}`,
      "Content-Type": "application/json",
      Accept: "application/json",
    },
  })
    .then((res) => res.json())
    .then((json) => {
      // console.log("ini respon");
      // console.log(json);

      if (json.hasOwnProperty("error")) {
        if (!json.error) {
          Swal.fire({
            position: "top-center",
            icon: "success",
            title: "Logout Success",
            showConfirmButton: false,
            timer: 1500,
          });

          sessionStorage.clear();
          window.location.href = "/";
        } else {
          Swal.fire({
            position: "top-center",
            icon: "error",
            title: "Logout Failed",
            showConfirmButton: false,
            html: json.message,
            timer: 1500,
          });
        }
      } else {
        sessionStorage.clear();
        window.location.href = "/";
      }
    });
};

function Navigation() {
  const [login_status, setLoginStatus] = useState(false);
  let location = useLocation();

  useEffect(() => {
    const token = sessionStorage.getItem("access_token");
    if (token == null || token == "undefined") {
      // login_status = false;
      setLoginStatus(false);
    } else {
      // login_status = true;
      setLoginStatus(true);
    }

    console.log("Current URL Location");
    console.log(location);
    console.log("Status Login");
    console.log(login_status);
    console.log(token);
    console.log("--------------------------------");
  }, [location]);

  let navStyle;
  if (location.pathname == "/") {
    navStyle = nav1style;
  } else {
    navStyle = nav2style;
  }

  return (
    <>
      <div>
        {/* Path : {location.pathname} */}

        <Navbar
          collapseOnSelect
          expand="lg"
          className="pt-3 pb-3"
          style={navStyle}
        >
          <Container>
            <Navbar.Brand
              as={Link}
              to={"/"}
              style={{
                color: "white",
                fontWeight: "700",
                fontStyle: "italic",
                fontSize: "150%",
              }}
            >
              <img
                src={logo}
                width="30"
                height="30"
                alt="Our logo"
                style={{ marginRight: "15px" }}
              />
              CYBERNET.
            </Navbar.Brand>
            <Navbar.Toggle aria-controls="responsive-navbar-nav" />
            <Navbar.Collapse id="responsive-navbar-nav">
              <Nav className="me-auto">
                <Nav.Link as={Link} to={"/"} style={whiteText}>
                  Home
                </Nav.Link>
                <Nav.Link as={Link} to={"/Product"} style={whiteText}>
                  Product
                </Nav.Link>
                <Nav.Link as={Link} to={"/Contact"} style={whiteText}>
                  Contact
                </Nav.Link>
                <Nav.Link as={Link} to={"/AboutUs"} style={whiteText}>
                  About Us
                </Nav.Link>

                {/* <NavDropdown title="Dropdown" id="collasible-nav-dropdown">
                  <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
                  <NavDropdown.Item href="#action/3.2">
                    Another action
                  </NavDropdown.Item>
                  <NavDropdown.Item href="#action/3.3">
                    Something
                  </NavDropdown.Item>
                  <NavDropdown.Divider />
                  <NavDropdown.Item href="#action/3.4">
                    Separated link
                  </NavDropdown.Item>
                </NavDropdown> */}
              </Nav>
              {(() => {
                if (login_status) {
                  return (
                    <>
                      <Nav>
                        <Nav.Link as={Link} to={"/Dashboard"} style={whiteText}>
                          Dashboard
                        </Nav.Link>
                      </Nav>
                      <Nav>
                        <Nav.Link onClick={logout_aksi}>
                          <Button variant="danger">Logout</Button>
                        </Nav.Link>
                      </Nav>
                    </>
                  );
                } else {
                  return (
                    <>
                      <Nav>
                        <Nav.Link as={Link} to={"/Login"}>
                          <Button variant="warning">Login</Button>
                        </Nav.Link>
                      </Nav>
                    </>
                  );
                }
              })()}
              {/* <Nav>
                <Nav.Link as={Link} to={"/Login"}>
                  <Button variant="warning">Login</Button>
                </Nav.Link>
              </Nav>
              <Nav>
                <Nav.Link as={Link} to={"/Dashboard"} style={whiteText}>
                  Dashboard
                </Nav.Link>
              </Nav>
              <Nav>
                <Nav.Link as={Link} to={"/Login"}>
                  <Button variant="danger">Logout</Button>
                </Nav.Link>
              </Nav> */}
              {/* <Nav>
                <Nav.Link as={Link} to={"/Order"}>
                  <Button variant="warning">Order Now</Button>
                </Nav.Link>
              </Nav> */}
            </Navbar.Collapse>
          </Container>
        </Navbar>
      </div>

      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/Product" element={<Product />} />
        <Route path="/Contact" element={<Contact />} />
        <Route path="/AboutUs" element={<AboutUs />} />
        <Route path="/Order" element={<Order />} />
        <Route path="/Login" element={<Login />} />
        <Route path="/Dashboard" element={<Dashboard />} />
      </Routes>
    </>
  );
}

export default Navigation;
